import React, { useState } from 'react';

import { BrowserRouter as Router, Link } from "react-router-dom";
import { signOut } from "firebase/auth";
import { auth } from '../config/firebase';

import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Image from 'react-bootstrap/Image';

import Dropdown from 'react-bootstrap/Dropdown';
import NavItem from 'react-bootstrap/NavItem';
import NavLink from 'react-bootstrap/NavLink';


function Header({ isAuth, setIsAuth }) {


    const [isSelect1, setIsSelect1] = useState(1);
    const [isSelect2, setIsSelect2] = useState(0);
    const [isSelect3, setIsSelect3] = useState(0);
    const [isSelect4, setIsSelect4] = useState(0);
    const [isSelect5, setIsSelect5] = useState(0);

    const onClickHeader1 = () => {
        if (isSelect1 == 1) {

        } else if (isSelect1 == 0) {
            setIsSelect1(1)
            setIsSelect2(0)
            setIsSelect3(0)
            setIsSelect4(0)
            setIsSelect5(0)
        }
    }
    const onClickHeader2 = () => {
        if (isSelect2 == 1) {

        } else if (isSelect2 == 0) {
            setIsSelect1(0)
            setIsSelect2(1)
            setIsSelect3(0)
            setIsSelect4(0)
            setIsSelect5(0)
        }
    }
    const onClickHeader3 = () => {
        if (isSelect3 == 1) {

        } else if (isSelect3 == 0) {
            setIsSelect1(0)
            setIsSelect2(0)
            setIsSelect3(1)
            setIsSelect4(0)
            setIsSelect5(0)
        }
    }
    const onClickHeader4 = () => {
        if (isSelect4 == 1) {

        } else if (isSelect4 == 0) {
            setIsSelect1(0)
            setIsSelect2(0)
            setIsSelect3(0)
            setIsSelect4(1)
            setIsSelect5(0)
        }
    }
    const onClickHeader5 = () => {
        if (isSelect5 == 1) {

        } else if (isSelect5 == 0) {
            setIsSelect1(0)
            setIsSelect2(0)
            setIsSelect3(0)
            setIsSelect4(0)
            setIsSelect5(1)
        }
    }

    const signUserOut = () => {
        signOut(auth).then(() => {
            localStorage.clear();
            setIsAuth(false);
            window.location.pathname = "/Login";
        });
    }

    return (

        <div>
            <Navbar bg="dark" variant='dark' expand="lg">
                <div id='nav-edit'>
                    <Navbar.Brand as={Link} to="/"><Image id='logo' src={require('../images/Captura5e.PNG')} roundedCircle /></Navbar.Brand>
                    <Navbar.Toggle aria-controls="basic-navbar-nav" />
                    <Navbar.Collapse id="basic-navbar-nav">
                        <Nav className="me-auto mt-2 mt-lg-3 margin-nav">
                            <Nav.Link as={Link} to="/" onClick={onClickHeader1} className={`under ${isSelect1 == 1 ? 'under-active' : ''}`}><h2>INICIO</h2></Nav.Link>
                            <Nav.Link as={Link} to={!isAuth ? "/Login" : "/Tournaments"} onClick={onClickHeader2} className={`under ${isSelect2 == 1 ? 'under-active' : ''}`}><h2>TORNEOS</h2></Nav.Link>
                            <Nav.Link as={Link} to="/About" onClick={onClickHeader3} className={`under ${isSelect3 == 1 ? 'under-active' : ''}`}><h2>JUGAR</h2></Nav.Link>
                            <Nav.Link as={Link} to="/Contact" onClick={onClickHeader4} className={`under ${isSelect4 == 1 ? 'under-active' : ''}`}><h2>CONTACTO</h2></Nav.Link>

                            {!isAuth &&
                                <Nav.Link as={Link} to="/Login" onClick={onClickHeader5} className={`under-login ${isSelect5 == 1 ? 'under-active' : ''}`}><h3>LOGIN</h3></Nav.Link>
                            }
                            {isAuth &&
                                <Nav.Link as={Link} to="#" className='under-login' onClick={signUserOut}><h3>LogOut</h3></Nav.Link>
                            }

                        </Nav>

                    </Navbar.Collapse>
                </div>
            </Navbar>

        </div>

    )

}
export default Header
